import React from "react";
import "./Buttons.scss";

export default function Buttons() {
  return (
    <div className="pageBtn">
      <button>1</button>
      <button>2</button>
      <button>3</button>
      <button>4</button>
      <button>5</button>
    </div>
  );
}
